import { Container } from '@material-ui/core';
import React, { Component } from 'react';
import { }from "./Atribut";
import { Input, BlueButton } from './Atribut';
import {Form,Row,Col} from 'react-bootstrap/'
class FormRegis extends Component {
    render() {
        return (
           <div>
               <Form>
                   <h4>Masukan Data Diri</h4>
                <Row>
                    <Col>
                    <Form.Control placeholder="First name" className="inputForm"/>
                    </Col>
                    <Col>
                    <Form.Control placeholder="Last name" className="inputForm"/>
                    </Col>
                </Row>
                </Form>
            </div>
        );
    }
}

export default FormRegis;
